package main

import (
	"path/filepath"
	"runtime"
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestReadLines(t *testing.T) {
	_, filename, _, _ := runtime.Caller(0)
	var fileDir = filepath.Dir(filename)
	var inputFile = filepath.Join(fileDir, "../../testfiles/hostperfdata")

	lines, error := readLines(inputFile)
	assert.Nil(t, error)
	assert.NotNil(t, lines)
	assert.Equal(t, []string{
		"timestamp::1623407324!**!*!**!host::bkpvieadm01_H12712005!**!*!**!service::CI-Alive!**!*!**!state::0!**!*!**!perfdata::rta=1.948000ms;3000.000000;5000.000000;0.000000 pl=0%;80;100;0!**!*!**!ciid::H12712005!**!*!**!ciname::bkpvieadm01!**!*!**!monitoringprofile::profiledev-default-mid-datadomain!**!*!**!customer::INTERN_SHARED!**!*!**!output::PING OK - Packet loss = 0%, RTA = 1.95 ms",
		"timestamp::1623407330!**!*!**!host::NAEMON-EVENTGENERATOR_A12434737!**!*!**!service::CI-Alive!**!*!**!state::0!**!*!**!perfdata::rta=0.044000ms;3000.000000;5000.000000;0.000000 pl=0%;80;100;0!**!*!**!ciid::A12434737!**!*!**!ciname::NAEMON-EVENTGENERATOR!**!*!**!monitoringprofile::profiledev-default-app-naemon-eventgenerator!**!*!**!customer::INTERN!**!*!**!output::PING OK - Packet loss = 0%, RTA = 0.04 ms",
		"timestamp::1623407330!**!*!**!host::sv120lxnaet1_H12819050!**!*!**!service::CI-Alive!**!*!**!state::0!**!*!**!perfdata::rta=3.897000ms;3000.000000;5000.000000;0.000000 pl=0%;80;100;0!**!*!**!ciid::H12819050!**!*!**!ciname::sv120lxnaet1!**!*!**!monitoringprofile::profiledev-default-app-checks-assigned-to-host!**!*!**!customer::INTERN!**!*!**!output::PING OK - Packet loss = 0%, RTA = 3.90 ms",
	}, lines)
}

